import React from 'react';
import { motion } from 'framer-motion';

import './App.css';
import { Navbar } from './components/navbar'


function App() {
  return (
    <div className="App">
      <motion.h1 animate={{x : 300}}>Hello</motion.h1>
      <Navbar />
    </div>
  );
}

export default App;
